import React, { useState } from 'react';
import ProjectCard from './ProjectCard';

const ProfileForm = () => {
  const [projects, setProjects] = useState([]);
  const [projectInput, setProjectInput] = useState({
    name: '',
    description: '',
    url: '',
    revenueUsers: '',
    status: 'building',
    category: '',
  });

  const addProject = () => {
    if (projectInput.name.trim() !== '') {
      setProjects([...projects, projectInput]);
      setProjectInput({
        name: '',
        description: '',
        url: '',
        revenueUsers: '',
        status: 'building',
        category: '',
      });
    }
  };

  const removeProject = (index) => {
    setProjects(projects.filter((_, i) => i !== index));
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setProjectInput({ ...projectInput, [name]: value });
  };

  return (
    <div className="bg-gray-900 text-white p-6 rounded-md w-full md:w-3/4 lg:w-1/2">
      <h1 className="text-2xl mb-4">Profile</h1>
      <form>
        <div className="mb-4">
          <label className="block mb-2">Name</label>
          <input type="text" className="w-full p-2 rounded-md bg-gray-800 border border-gray-700" />
        </div>
        <div className="mb-4">
          <label className="block mb-2">Bio</label>
          <input type="text" className="w-full p-2 rounded-md bg-gray-800 border border-gray-700" />
        </div>
        <div className="mb-4">
          <label className="block mb-2">Location</label>
          <input type="text" className="w-full p-2 rounded-md bg-gray-800 border border-gray-700" />
        </div>
        <div className="mb-4">
          <label className="block mb-2">Education</label>
          <input type="text" className="w-full p-2 rounded-md bg-gray-800 border border-gray-700" />
        </div>
        <div className="mb-4">
          <label className="block mb-2">Work Experience</label>
          <input type="text" className="w-full p-2 rounded-md bg-gray-800 border border-gray-700" />
        </div>
        <div className="mb-4">
          <label className="block mb-2">Projects</label>
          <div className="mb-4">
            <label className="block mb-2">Name</label>
            <input
              type="text"
              name="name"
              value={projectInput.name}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            />
          </div>
          <div className="mb-4">
            <label className="block mb-2">Description</label>
            <input
              type="text"
              name="description"
              value={projectInput.description}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            />
          </div>
          <div className="mb-4">
            <label className="block mb-2">URL</label>
            <input
              type="text"
              name="url"
              value={projectInput.url}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            />
          </div>
          <div className="mb-4">
            <label className="block mb-2">Revenue/Users</label>
            <input
              type="text"
              name="revenueUsers"
              value={projectInput.revenueUsers}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            />
          </div>
          <div className="mb-4">
            <label className="block mb-2">Status</label>
            <select
              name="status"
              value={projectInput.status}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            >
              <option value="building">Building</option>
              <option value="sold">Sold</option>
              <option value="active">Active</option>
            </select>
          </div>
          <div className="mb-4">
            <label className="block mb-2">Category</label>
            <input
              type="text"
              name="category"
              value={projectInput.category}
              onChange={handleInputChange}
              className="w-full p-2 rounded-md bg-gray-800 border border-gray-700"
            />
          </div>
          <div className="flex items-center">
            <button type="button" onClick={addProject} className="ml-2 p-2 bg-pink-500 rounded-md">
              Add Project
            </button>
          </div>
          <ul className="mt-2">
            {projects.map((project, index) => (
              <ProjectCard key={index} project={project} onRemove={() => removeProject(index)} />
            ))}
          </ul>
        </div>
      </form>
      <div className="mt-6">
        <button className="p-2 bg-pink-500 rounded-md">Save Profile</button>
      </div>
    </div>
  );
};

export default ProfileForm;
